import React from "react";
import { Container, Typography, TextField, Button, Grid } from "@mui/material";
import {
  GoogleLoginButton,
  FacebookLoginButton,
} from "react-social-login-buttons";
import backgroundImage from "../components/join-us-today960.png"; // Import your background image

function SignUp() {
  return (
    <Grid container>
      {/* Left side: Sign-up form */}
      <Grid item xs={12} md={6}>
        <Container maxWidth="xs">
          <div
            style={{
              marginTop: "10rem",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <Typography variant="h4" gutterBottom>
              Sign Up
            </Typography>
            <form
              style={{ width: "100%", marginTop: "1rem" }}
              noValidate
              autoComplete="off"
            >
              <TextField
                fullWidth
                id="username"
                label="Username"
                variant="outlined"
                margin="normal"
              />
              {/* Add more TextField components for other form fields */}
              <Button
                variant="contained"
                color="primary"
                fullWidth
                style={{ marginTop: "1rem" }}
              >
                Sign Up
              </Button>
            </form>
            <Typography variant="body2" style={{ marginTop: "1rem" }}>
              Or sign up with:
            </Typography>
            <Grid
              container
              spacing={2}
              justifyContent="center"
              style={{ marginTop: "0.5rem" }}
            >
              <Grid item xs={6}>
                <GoogleLoginButton
                  onClick={() => console.log("Google clicked")}
                />
              </Grid>
              <Grid item xs={6}>
                <FacebookLoginButton
                  onClick={() => console.log("Facebook clicked")}
                />
              </Grid>
            </Grid>
          </div>
        </Container>
      </Grid>
      {/* Right side: Image */}
      <Grid
        item
        xs={12}
        md={6}
        style={{
          height: "70vh",
          display: "flex-end",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        {/* Add content if needed */}
        <img
          src={backgroundImage}
          alt="Join Us"
          style={{ maxWidth: "100%", maxHeight: "80%", height: "auto" }}
        />
      </Grid>
    </Grid>
  );
}

export default SignUp;
